import "./Contact.scss";
import Logo from "../Logo/Logo";
import Navigation from "../Navigation/Navigation";

export default function Contact() {
  return (
    <>
      <Logo />

      <div className="description">
        <h1>Mobile marketing w nowym wydaniu</h1>
        <p>Spróbuj kreatywnego i nieszablonowego podejścia do reklamy.</p>
        <p>
          Stwórz z nami dopasowane i przyciągające formaty reklamowe - bo wiemy,
          jak dotrzeć do Twojej grupy docelowej.
        </p>
      </div>

      <img src="assets/contact_mockup.png" class="mockup_contact" />

      <h2>3 podstawowe kroki w mobile </h2>

      <Navigation />
    </>
  );
}
